import React from "react";
import "./login.css";

class Login extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            fields: {},
            errors: {},
        }
    }
    handleChange = (e) => {
        let fields = this.state.fields;
        fields[e.target.name] = e.target.value;
        this.setState({
            fields: fields
        });
    }
    submituserRegistrationForm = () => {
        e.preventDefault();
        console.log("submituserRegistrationForm")
    }
    render() {
        console.log("this.state.fields", this.state.fields)
        return (
            <div className="login_wapper">
                <div className="login_container">

                    <form action="" onSubmit={() =>this.submituserRegistrationForm()}>
                        <input
                            type="text"
                            name="username"
                            onChange={(e) => this.handleChange(e)}
                            placeholder="enter your name"
                        />
                        <div className="errorMsg">{ }</div>
                        <input
                            type="email"
                            name="emailid"
                            onChange={(e) => this.handleChange(e)}
                            placeholder="enter your email id"
                        />
                        <div className="errorMsg">{ }</div>
                        <input
                            type="date"
                            name="date"
                            onChange={(e) => this.handleChange(e)}
                        />
                        <div className="errorMsg">{ }</div>
                        <input
                            type="password"
                            name="password"
                            onChange={(e) => this.handleChange(e)}
                            placeholder="enter your password"
                        />
                        <div className="errorMsg">{ }</div>
                        <input
                            type="submit"
                            className="button"
                            value="Register"
                        />
                    </form>

                </div>
            </div>
        )
    }
}


export default Login;
